import React from 'react';
import NavBar from '../nav/nav.js'
import './about.css'
import Footer from '../footer/footer.js'


const About = () => {
    return (
        <div>
            <NavBar />
            <div className="about" style={{height: `${window.innerHeight - 50}px`}}>
                <h1>About</h1>
            </div>
            <Footer />
        </div>
    );
};

export default About;
